import React, { useState } from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { updateAvailability } from '../../store/slices/dashboardSlice';
import { toast } from 'react-toastify';

const AvailabilityToggle = () => {
  const dispatch = useDispatch();
  const { partner } = useSelector((state) => state.auth);
  const { stats, loading } = useSelector((state) => state.dashboard);
  const [isToggling, setIsToggling] = useState(false);

  const handleAvailabilityChange = async (newStatus) => {
    if (!partner?.deliveryPartner?.id || isToggling) return;

    setIsToggling(true);
    
    try {
      let isAvailable, availabilityStatus;
      
      switch (newStatus) {
        case 'ONLINE':
          isAvailable = true;
          availabilityStatus = 'ONLINE';
          break;
        case 'OFFLINE':
          isAvailable = false;
          availabilityStatus = 'OFFLINE';
          break;
        case 'BUSY':
          isAvailable = false;
          availabilityStatus = 'BUSY';
          break;
        default:
          return;
      }

      await dispatch(updateAvailability({
        partnerId: partner.deliveryPartner.id,
        isAvailable,
        availabilityStatus
      })).unwrap();

      toast.success(`Status updated to ${newStatus.toLowerCase()}`);
    } catch (error) {
      toast.error(error || 'Failed to update availability');
    } finally {
      setIsToggling(false);
    }
  };

  const getStatusColor = (status) => {
    switch (status) {
      case 'ONLINE':
        return 'bg-green-100 text-green-800 border-green-200';
      case 'BUSY':
        return 'bg-yellow-100 text-yellow-800 border-yellow-200';
      case 'OFFLINE':
        return 'bg-gray-100 text-gray-800 border-gray-200';
      default:
        return 'bg-gray-100 text-gray-800 border-gray-200';
    }
  };

  const getStatusIcon = (status) => {
    switch (status) {
      case 'ONLINE':
        return (
          <div className="w-2 h-2 bg-green-500 rounded-full"></div>
        );
      case 'BUSY':
        return (
          <div className="w-2 h-2 bg-yellow-500 rounded-full"></div>
        );
      case 'OFFLINE':
        return (
          <div className="w-2 h-2 bg-gray-500 rounded-full"></div>
        );
      default:
        return (
          <div className="w-2 h-2 bg-gray-500 rounded-full"></div>
        );
    }
  };

  const currentStatus = stats.availabilityStatus || 'OFFLINE';

  return (
    <div className="relative">
      {/* Current Status Display */}
      <div className={`flex items-center space-x-2 px-3 py-2 rounded-lg border ${getStatusColor(currentStatus)}`}>
        {getStatusIcon(currentStatus)}
        <span className="text-sm font-medium">
          {currentStatus.charAt(0) + currentStatus.slice(1).toLowerCase()}
        </span>
      </div>

      {/* Status Options - Mobile Friendly */}
      <div className="mt-2 flex flex-col sm:flex-row space-y-1 sm:space-y-0 sm:space-x-2">
        <button
          onClick={() => handleAvailabilityChange('ONLINE')}
          disabled={isToggling || loading || currentStatus === 'ONLINE'}
          className={`px-3 py-1 rounded-md text-xs font-medium transition-colors duration-200 ${
            currentStatus === 'ONLINE'
              ? 'bg-green-100 text-green-800 cursor-not-allowed'
              : 'bg-white text-green-700 border border-green-300 hover:bg-green-50'
          } ${isToggling || loading ? 'opacity-50 cursor-not-allowed' : ''}`}
        >
          {isToggling && currentStatus !== 'ONLINE' ? 'Updating...' : 'Available'}
        </button>

        <button
          onClick={() => handleAvailabilityChange('BUSY')}
          disabled={isToggling || loading || currentStatus === 'BUSY'}
          className={`px-3 py-1 rounded-md text-xs font-medium transition-colors duration-200 ${
            currentStatus === 'BUSY'
              ? 'bg-yellow-100 text-yellow-800 cursor-not-allowed'
              : 'bg-white text-yellow-700 border border-yellow-300 hover:bg-yellow-50'
          } ${isToggling || loading ? 'opacity-50 cursor-not-allowed' : ''}`}
        >
          {isToggling && currentStatus !== 'BUSY' ? 'Updating...' : 'Busy'}
        </button>

        <button
          onClick={() => handleAvailabilityChange('OFFLINE')}
          disabled={isToggling || loading || currentStatus === 'OFFLINE'}
          className={`px-3 py-1 rounded-md text-xs font-medium transition-colors duration-200 ${
            currentStatus === 'OFFLINE'
              ? 'bg-gray-100 text-gray-800 cursor-not-allowed'
              : 'bg-white text-gray-700 border border-gray-300 hover:bg-gray-50'
          } ${isToggling || loading ? 'opacity-50 cursor-not-allowed' : ''}`}
        >
          {isToggling && currentStatus !== 'OFFLINE' ? 'Updating...' : 'Offline'}
        </button>
      </div>

      {/* Status Description */}
      <div className="mt-2 text-xs text-gray-500">
        {currentStatus === 'ONLINE' && 'You can receive new orders'}
        {currentStatus === 'BUSY' && 'You won\'t receive new orders'}
        {currentStatus === 'OFFLINE' && 'You\'re not available for orders'}
      </div>
    </div>
  );
};

export default AvailabilityToggle;
